///////////////////////////////////
// STREAMER.BOT WEBSOCKET SERVER //
///////////////////////////////////

let sbServerAddress = "127.0.0.1";
let sbServerPort = "8080";
let sbDebugMode = false;

// This is the main function that connects to the Streamer.bot websocke server
const ws = new WebSocket("ws://" + sbServerAddress + ":" + sbServerPort + "/");
function connectws(ws) {
  if ("WebSocket" in window) {
    startGame();

    // Reconnect
    ws.onclose = function () {
      SetConnectionStatus(false);
      setTimeout(connectws(ws), 5000);
    };

    // Connect
    ws.onopen = async function () {
      SetConnectionStatus(true);
      if (sbDebugMode) {
        console.log("New instance started");
        console.log("Subscribe to events");
      }
      ws.send(
        JSON.stringify({
          request: "Subscribe",
          id: "subscribe-events-id",
          events: {
            // This is the list of Streamer.bot websocket events to subscribe to
            // See full list of events here:
            // https://wiki.streamer.bot/en/Servers-Clients/WebSocket-Server/Requests
            fileWatcher: [
              "Changed"
            ]
          }
        })
      );

      ws.onmessage = function (event) {
        // Grab message and parse JSON
        const msg = event.data;
        const wsdata = JSON.parse(msg);

        if (typeof wsdata.event == "undefined") {
          return;
        }

        // Print data to log for debugging purposes
        if (sbDebugMode) {
          console.log(wsdata.event.source);
          console.log(wsdata.event.type);
          console.log(wsdata.data);
        }

        // Check for events to trigger
        // See documentation for all events here:
        // https://wiki.streamer.bot/en/Servers-Clients/WebSocket-Server/Events
        switch (wsdata.event.source) {

          // fileWatcher Events
          case 'FileWatcher':
            switch (wsdata.event.type) {
              case ('Changed'):
                if (sbDebugMode) {
                  console.log(JSON.stringify(wsdata.data));
                }
                //sbDoAction(ws, "", wsdata.data);
                updateBoard(wsdata.data);
                break;
            }
            break;

        }
      };
    }
  }
}

//////////////////
// UPDATE BOARD //
//////////////////

function startGame() {
  addDivs();
  if (sbDebugMode) {
    //document.getElementById('debug').innerHTML = "Game Started";
  }
  preloadImage('code-breaker-main-board-01.jpg');
  preloadImage('code-breaker-main-board-02.jpg');
  preloadImage('code-breaker-main-board-03.jpg');
  preloadImage('code-breaker-main-board-04.jpg');
  preloadImage('code-breaker-main-board-05.jpg');
  preloadImage('code-breaker-main-board-06.jpg');
  preloadImage('code-breaker-main-board-07.jpg');
  preloadImage('blue.png');
  preloadImage('red.png');
  preloadImage('green.png');
  preloadImage('yellow.png');
  preloadImage('pink.png');
  preloadImage('white.png');
  var steps = [1,1,1,2,3,4,5,5,6,6,6,7];
  for (var i = 0; i <= steps.length; i++) {
    delay = (500 * (i+1));
    setBoard(delay, steps[i], (i+1));
  }
}

function preloadImage(url) {
  var img=new Image();
  img.src=url;
}

function setBoard(delay, step, count) {
  setTimeout(function(){
    if (step) {
      if (step > 1) {
        document.getElementById('outer_container').classList.remove("step" + (step-1));
      }
      document.getElementById('outer_container').classList.add("step" + step);
      var steps_click_sound = [3,4,5,6,7];
      if (steps_click_sound.includes(count)) {
        var audio = new Audio('data:audio/wav;base64,');
        audio.play();
      }
      var steps_close_answer = [8];
      if (steps_close_answer.includes(count)) {
        var audio = new Audio('data:audio/wav;base64,');
        audio.play();
      }
      if (count == 12) {
        sbDoAction(ws, "[Code-Breaker] Redeem ON", "");
      }
    }
  }, (delay));
}

function addDivs() {
  var div_ids = ["profile_image", "result1", "result2", "result3", "result4", "color1", "color2", "color3", "color4"];
  setTimeout(function(){    var div = document.createElement('div');

    // answer
    for (var a = 0; a < 4; a++) {
      var div = document.createElement('div');
      var id = "answer_color" + (a+1);
      div.setAttribute("id", id);
      var div_class = "answer color color" + (a+1);
      div.setAttribute("class", div_class);
      document.getElementById("outer_container").appendChild(div);
    }

    // 8 guesses
    for (var i = 0; i < 8; i++) {
      for (var k = 0; k < div_ids.length; k++) {
        var div = document.createElement('div');
        var id = "guess" + (i+1) +  "_" + div_ids[k];
        div.setAttribute("id", id);
        var div_class = div_ids[k];
        if (div_ids[k].includes("result")) { div_class = "result " + div_class }
        if (div_ids[k].includes("color")) { div_class = "color " + div_class }
        div_class = "guess" + (i+1) +  " " + div_class;
        div.setAttribute("class", div_class);
        document.getElementById("outer_container").appendChild(div);
      }
    }

    // win container
    var div = document.createElement('div');
    var id = "win_screen_container";
    div.setAttribute("id", id);
    var div_class = "win_screen_container";
    div.setAttribute("class", div_class);
    document.getElementById("win_screen").appendChild(div);

    // winner text
    var div = document.createElement('div');
    var div_class = "winner";
    div.setAttribute("class", div_class);
    div.innerHTML = "Winner";
    document.getElementById("win_screen_container").appendChild(div);

    // targetUserProfileImageUrl
    var div = document.createElement('div');
    var id = "targetUserProfileImageUrl";
    div.setAttribute("id", id);
    var div_class = "targetUserProfileImageUrl";
    div.setAttribute("class", div_class);
    document.getElementById("win_screen_container").appendChild(div);

    // targetUser
    var div = document.createElement('div');
    var id = "targetUser";
    div.setAttribute("id", id);
    var div_class = "targetUser";
    div.setAttribute("class", div_class);
    document.getElementById("win_screen_container").appendChild(div);

    // gameover container
    var div = document.createElement('div');
    var id = "gameover_screen_container";
    div.setAttribute("id", id);
    var div_class = "gameover_screen_container";
    div.setAttribute("class", div_class);
    document.getElementById("gameover_screen").appendChild(div);

    // gameover text
    var div = document.createElement('div');
    var div_class = "gameover";
    div.setAttribute("class", div_class);
    div.innerHTML = "Failed!<br/>Game Over";
    document.getElementById("gameover_screen_container").appendChild(div);

  }, (1000));
}

function updateBoard(data) {
  if (sbDebugMode) {
    document.getElementById('debug').innerHTML = "";
    Object.keys(data.data).forEach(function(key) {
      //console.log('Key : ' + key + ', Value : ' + data.data[key])
      document.getElementById('debug').style.display = "block";
      if (document.getElementById('debug').innerHTML != "") {
        document.getElementById('debug').innerHTML += "<br/>";
      }
      document.getElementById('debug').innerHTML += "Key : " + key + ", Value : " + data.data[key];
    })
  }
  fileData = data.data;
  answer = fileData['answer'];
  answer_split = answer.split(",");
  for (var a = 0; a < answer_split.length; a++) {
    document.getElementById("answer_color" + (a+1)).style.backgroundImage = "url('" + gamePiece(answer_split[a]) + "')";
    document.getElementById("answer_color" + (a+1)).style.opacity = 0;
  }
  for (var i = 0; i < 8; i++) {
    if ((fileData['guess' + (i+1)]) && (fileData['guess' + (i+1)] != "")) {
      fileData['guess' + (i+1)] = JSON.parse(fileData['guess' + (i+1)]);
      if (fileData['guess' + (i+1)]['guess']) {
        var colors = fileData['guess' + (i+1)]['guess'].split(",");
        var guess_result = [];
        for (var k = 0; k < colors.length; k++) {
          document.getElementById("guess" + (i+1) + "_color" + (k+1)).style.backgroundImage = "url('" + gamePiece(colors[k]) + "')";
          document.getElementById("guess" + (i+1) + "_color" + (k+1)).style.opacity = 1;
          if (colors[k] == answer_split[k]) {
            guess_result.push("hit");
          } else if (answer_split.includes(colors[k])) {
            guess_result.push("blow");
          }
        }
        guess_result.sort();
        guess_result.reverse();
        for (var r = 0; r < guess_result.length; r++) {
          document.getElementById("guess" + (i+1) + "_result" + (r+1)).style.backgroundImage = "url('" + gamePiece(guess_result[r]) + "')";
          document.getElementById("guess" + (i+1) + "_result" + (r+1)).style.opacity = 1;
        }
        if (fileData['guess' + (i+1)]['guess'] == answer) {
          victory();
        }
      } else {
        clearGuess(i);
      }
      if (fileData['guess' + (i+1)]['targetUserProfileImageUrl']) {
        document.getElementById("guess" + (i+1) + "_profile_image").style.backgroundImage = "url('" + fileData['guess' + (i+1)]['targetUserProfileImageUrl'] + "')";
        document.getElementById("guess" + (i+1) + "_profile_image").style.opacity = 1;
        document.getElementById("targetUser").innerHTML = fileData['guess' + (i+1)]['targetUser'];
        document.getElementById("targetUserProfileImageUrl").style.backgroundImage = "url('" + fileData['guess' + (i+1)]['targetUserProfileImageUrl'] + "')";
      }
    } else {
      clearGuess(i);
    }
  }
  if ((fileData['guess8'] != "") && (fileData['guess8']['guess'] != answer)) {
    gameOver();
  }
}

function gamePiece(option) {
  if (option == "b") { return "blue.png"; }
  if (option == "r") { return "red.png"; }
  if (option == "g") { return "green.png"; }
  if (option == "y") { return "yellow.png"; }
  if (option == "p") { return "pink.png"; }
  if (option == "w") { return "white.png"; }
  if (option == "hit") { return "red-hit.png"; }
  if (option == "blow") { return "white-blow.png"; }
  return "";
}

function victory() {
  showAnswer();
  setTimeout(function(){
    document.getElementById("win_screen").style.opacity = 1;
  }, (1500));
  setTimeout(function(){
    var audio = new Audio('data:audio/wav;base64,');
    audio.play();
  }, (2000));
  setTimeout(function(){
    sbDoAction(ws, "[Code-Breaker] Redeem OFF", "");
    clearData();
  }, (12000));
}

function gameOver() {
  showAnswer();
  setTimeout(function(){
    document.getElementById("gameover_screen").style.opacity = 1;
  }, (1500));
  setTimeout(function(){
    var audio = new Audio('data:audio/wav;base64,');
    audio.play();
  }, (2000));
  setTimeout(function(){
    sbDoAction(ws, "[Code-Breaker] Redeem OFF", "");
    clearData();
  }, (10000));
}

function showAnswer() {
  document.getElementById('outer_container').classList.remove("step7");
  document.getElementById('outer_container').classList.add("step1");
  var audio = new Audio('data:audio/wav;base64,');
  audio.play();
  for (var a = 0; a < 4; a++) {
    document.getElementById("answer_color" + (a+1)).style.opacity = 1;
  }
}

function clearGuess(i) {
  document.getElementById("guess" + (i+1) + "_profile_image").style.backgroundImage = "unset";
  document.getElementById("guess" + (i+1) + "_profile_image").style.opacity = 0;
  for (var k = 0; k < 4; k++) {
    document.getElementById("guess" + (i+1) + "_color" + (k+1)).style.backgroundImage = "unset";
    document.getElementById("guess" + (i+1) + "_color" + (k+1)).style.opacity = 0;
  }
  for (var r = 0; r < 4; r++) {
    document.getElementById("guess" + (i+1) + "_result" + (r+1)).style.backgroundImage = "unset";
    document.getElementById("guess" + (i+1) + "_result" + (r+1)).style.opacity = 0
  }
}

function clearData() {
  for (var a = 0; a < 4; a++) {
    document.getElementById("answer_color" + (a+1)).style.backgroundImage = "unset";
    document.getElementById("answer_color" + (a+1)).style.opacity = 0;
  }
  for (var i = 0; i < 8; i++) {
    document.getElementById("guess" + (i+1) + "_profile_image").style.backgroundImage = "unset";
    document.getElementById("guess" + (i+1) + "_profile_image").style.opacity = 0;
    for (var k = 0; k < 4; k++) {
      document.getElementById("guess" + (i+1) + "_color" + (k+1)).style.backgroundImage = "unset";
      document.getElementById("guess" + (i+1) + "_color" + (k+1)).style.opacity = 0;
    }
    for (var r = 0; r < 4; r++) {
      document.getElementById("guess" + (i+1) + "_result" + (r+1)).style.backgroundImage = "unset";
      document.getElementById("guess" + (i+1) + "_result" + (r+1)).style.opacity = 0
    }
  }
  document.getElementById("win_screen").style.opacity = 0;
  document.getElementById("gameover_screen").style.opacity = 0;
}

//////////////////////
// HELPER FUNCTIONS //
//////////////////////

function sbDoAction(ws, actionName, data) {
  var request = JSON.stringify({
    request: "DoAction",
    id: "subscribe-do-action-id",
    action: {
      name: actionName
    },
    args: {
      data
    }
  });
  ws.send(request);
}

